import React from 'react';
import {
    ChakraProvider,
    Box,
    Text,
    Link,
    VStack,
    Code,
    Grid,
    theme,
    Container,
    Flex,
    Center,
    Square
} from '@chakra-ui/react';

const LandingPage = () => {
    return (
        <Container maxW='container.lg' bg='pink' color='#262626'>
            <Flex color='white'>
                <Box flex='1' bg='white' size='50vh'>
                    <Text>Box 3</Text>
                </Box>
                <Box flex='1' bg='tomato'>
                    <Text>Box 3</Text>
                </Box>
            </Flex>
        </Container>

    );
}

export default LandingPage;
